import {AppBar, Box, Button, Container, Toolbar, Typography} from '@mui/material'
import { Link } from 'react-router-dom'


function Menu() {
  return (
    <Box sx={{flexGrow: 1}}> {/**recuadro */} {/** el sx es para indicar que el tamaño en pantallas pequeñas Y que abarque todo el ancho disponible*/}
      <AppBar position='static' color='transparent'>{/**navegacion, le damos los estilos  */}
        <Container>{/**para centrarlo */}
          <Toolbar> {/** son las opciones del menu */}
              <Typography>{/** aqui se colocan los textos dentro de material ui */}
                  <Link to='/'> {/** viene de router y se encarga de llevarnos a la ruta es como un a de html */}
                    PERN STACK
                  </Link>
                  <Button variant='contained' color='primary' sx={{flexGrow: 1}}>
                      Nuevo Usuario
                  </Button>
              </Typography>
          </Toolbar>
        </Container>
      </AppBar>
    </Box>
  )
}

export default Menu
